<script>
    import libSys from '@/components/baseComponent/libSys.js';
    import libUpload from '@/components/baseComponent/libUpload.js';

    export default {
        components: {},
        inject: ['sys'],
        props: {
            refId: String,
            para: Object,
            attr: {
                type: Object,
                default: function () {
                    return {size: 'medium'};
                },
                validator: function (val) {
                    if (!val.size) val.size = 'medium';
                    return true;
                },
            },
            number: Number,
        },
        data: function () {
            return {
                pvt_subModuleMap: {
                    vessel: ['titleTextDiv', 'startBtnDiv', 'tipTitleDiv', 'tooltipText1Div', 'tooltipText2Div', 'tooltipText3Div'],
                    subModule: ['titleText', 'startBtn', 'tipTitle', 'tooltipText1', 'tooltipText2', 'tooltipText3'],
                },
                pvt_isShow: {
                    titleTextDiv: null,
                    startBtnDiv: null,
                    tipTitleDiv: null,
                    tooltipText1Div: null,
                    tooltipText2Div: null,
                    tooltipText3Div: null,
                },
                pvt_win: {
                    isShow: {
                        luckyDrawHomePageWindow: true,
                        titleTextDiv: true,
                        startBtnDiv: true,
                        textBoxDiv: true,
                        tipTitleDiv: true,
                        tooltipText1Div: true,
                        tooltipText2Div: true,
                        tooltipText3Div: true,
                    },
                    isChecked: {
                        luckyDrawHomePageWindow: false,
                        titleTextDiv: false,
                        startBtnDiv: false,
                        textBoxDiv: false,
                        tipTitleDiv: false,
                        tooltipText1Div: false,
                        tooltipText2Div: false,
                        tooltipText3Div: false,
                    },
                    style: {
                        luckyDrawHomePageWindow: null,
                        titleTextDiv: null,
                        startBtnDiv: null,
                        textBoxDiv: null,
                        tipTitleDiv: null,
                        tooltipText1Div: null,
                        tooltipText2Div: null,
                        tooltipText3Div: null,
                    },
                },
                pvt_eventPortInput: ['lotteryBeganEvent'],
                startImage:null,
            };
        },
        watch: {},
        computed: {
            pvt_titleTextDiv: function () {
                return {
                    titleText: {
                        paraVarPair: {},
                        para: {
                            textData: '瓴码小体验',
                        },
                        attr: {
                            label: 'p',
                            textAlign: 'center',
                            fontWeight: true,
                            color: '#fff',
                            fontSize: '186px',
                        },
                    },
                };
            },
            pvt_startBtnDiv: function () {
                return {
                    startBtn: {
                        paraVarPair: {},
                        para: {
                            image: this.startImage,
                        },
                        attr: {
                            fit: 'none',
                            isClick: true,
                        },
                    },
                };
            },
            pvt_tipTitleDiv: function () {
                return {
                    tipTitle: {
                        paraVarPair: {},
                        para: {
                            textData: '////// 活动规则 //////',
                        },
                        attr: {
                            label: 'p',
                            textAlign: 'center',
                            fontWeight: true,
                            color: '#303133',
                            fontSize: '40px',
                        },
                    },
                };
            },
            pvt_tooltipText1Div: function () {
                return {
                    tooltipText1: {
                        paraVarPair: {},
                        para: {
                            textData: '打开',
                        },
                        attr: {
                            label: 'p',
                            color: '#303133',
                            fontSize: '38px',
                        },
                    },
                };
            },
            pvt_tooltipText2Div: function () {
                return {
                    tooltipText2: {
                        paraVarPair: {},
                        para: {
                            textData: '微信“扫一扫”',
                        },
                        attr: {
                            label: 'p',
                            textAlign: 'center',
                            fontWeight: true,
                            color: '#303133',
                            fontSize: '38px',
                        },
                    },
                };
            },
            pvt_tooltipText3Div: function () {
                return {
                    tooltipText3: {
                        paraVarPair: {},
                        para: {
                            textData: '，扫描大屏幕二维码即可参与',
                        },
                        attr: {
                            label: 'p',
                            color: '#303133',
                            fontSize: '38px',
                        },
                    },
                };
            },
        },
        created: function () {
            Object.assign(this, libSys, libUpload);
        },
        mounted: function () {
            this.pvt_initSysData();
        },
        methods: {
            setPara: function (successCallBack, errorCallBack) {
                var para = {};
                para.successCallBack = successCallBack;
                para.errorCallBack = errorCallBack;
                para.nStep = 0;
                return para;
            },
            startModule: function (successCallBack, errorCallBack) {
                let $this = this;
                let para;
                let dbFlag;
                let ref = {
                    sm1: 'titleText',
                    sm2: 'startBtn',
                    sm3:  'tipTitle',
                    sm4: 'tooltipText1',
                    sm5: 'tooltipText2',
                    sm6: 'tooltipText3',
                };
                if (successCallBack !== null) {
                    errorCallBack = $this.setPara(successCallBack, errorCallBack);
                    successCallBack = null;
                }
                para = errorCallBack;

                while (1) {
                    dbFlag = 0;
                    switch (para.nStep) {
                        case 0:
                            $this.startImage=['data:image/png;base64,'];
                            para.nStep = 'showSubModule';
                            ++dbFlag;
                            break;
                        case 'showSubModule':
                            $this.showSubModule([ref.sm1, ref.sm2, ref.sm3, ref.sm4, ref.sm5, ref.sm6], true, function () {
                                para.nStep = 'forceUpdateData';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'forceUpdateData':
                            $this.forceUpdateData(function () {
                                para.nStep = 'startModule1';
                                if (++dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            });
                            break;
                        case 'startModule1':
                            $this.sm[ref.sm1].startModule(function () {
                                para.nStep = 'startModule2';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'startModule2':
                            $this.sm[ref.sm2].startModule(function () {
                                para.nStep = 'startModule3';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'startModule3':
                            $this.sm[ref.sm3].startModule(function () {
                                para.nStep = 'startModule4';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'startModule4':
                            $this.sm[ref.sm4].startModule(function () {
                                para.nStep = 'startModule5';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'startModule5':
                            $this.sm[ref.sm5].startModule(function () {
                                para.nStep = 'startModule6';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'startModule6':
                            $this.sm[ref.sm6].startModule(function () {
                                para.nStep = 'end';
                                dbFlag += 1;
                                if (dbFlag === 2) {
                                    $this.startModule(successCallBack, errorCallBack)
                                }
                            }, para.errorCallBack);
                            break;
                        case 'end':
                            para.successCallBack('success');
                            return;
                        default:
                            para.errorCallBack('error');
                            return;
                    }
                    dbFlag += 1;
                    if (dbFlag === 1) return;
                }
            },
            startBtn_clickEvent: function (id) {
                this.ep.lotteryBeganEvent(id);
            },
        },
    };
</script>
